import React from "react"
import { Form } from "react-bootstrap"

const InputColor = ({ name }) => {
  return (
    <>
      <Form.Label htmlFor={name}>{name}</Form.Label>
      <Form.Control
        type="color"
        id={name}
        defaultValue="#563d7c"
        title={name}
      />
    </>
  )
}

export default InputColor
